	const handleAddQuote = (quoteData) => {
		console.log(quoteData);
		navigate('//quotes', { replace: true });
	};

	const navigate = useNavigate();

	return <QuoteForm onAddQuote={handleAddQuote} />;
};

export default NewQuote;
